	buf.push("<title> A fun night of code, waffles, and karaoke.</title><div" + (jade.cls([className], [true])) + "><section id=\"header\"><div class=\"container-fluid\"><div class=\"row between-xs\"><div class=\"col-xs-12 col-sm-6\"><h4 class=\"highlight\"><a ui-sref=\"index\">WaffleJS</a></h4></div><div class=\"col-xs-12 col-sm-6 end-sm\"><ul class=\"nav\"><li><a ui-sref=\"speakers\" class=\"light-gray\">Speakers</a></li><li><a ui-sref=\"performers\" class=\"light-gray\">Performers</a></li><li><a ui-sref=\"sponsorship\" class=\"light-gray\">Sponsorship</a></li></ul></div></div><div class=\"row bottom-sm\"><div class=\"col-xs-12 col-sm-7 headline\"><h1>A fun night of code, waffles, and karaoke</h1><h3>All proceeds go to <a href=\"http://girlswhocode.com\" class=\"black\">Girls Who Code.</a></h3></div><div class=\"col-xs-12 col-sm-5 details\"><h5>Date & Time</h5><h3>{{index.day.date | date:'EEEE, MMMM d':'UTC'}} at 7 PM</h3><h5>Location</h5><h3><a href=\"https://goo.gl/maps/0gkOe\" class=\"black\">SOMA StrEat Food Park </a>(in the <a class=\"black\" href=\"/map\" target=\"_self\">barn</a>)</h3></div></div></div></section><section id=\"hero\"><div class=\"container-fluid\"></div></section><section id=\"about\"><div class=\"container-fluid\"><div class=\"row\"><div class=\"col-xs-12 col-sm-6\"><h2 id=\"about\">About</h2>\n<p>WaffleJS is a meetup about web technology with a side of waffles\nand karaoke. We meet on the first Wednesday of every month.</p>\n<p>All participants are expected to follow the <a href=\"http://jsconf.com/codeofconduct.html\">JSConf Code of\nConduct</a>.</p>\n</div></div></div></section><section id=\"get-involved\"><div class=\"container-fluid\"><h2>Get Involved</h2><div class=\"row between-xs\"><div class=\"col-xs-12 col-sm-6\"><h3 id=\"give-a-talk\">Give a Talk</h3>\n<p>Your talk can be anything from knitting machines to the JavaScript v8 \nengine. And nope, you dont need to be an expert to speak.</p>\n<p><a ui-sref=\"speakers\" class=\"btn\">Speaker Details</a></p></div><div class=\"col-xs-12 col-sm-6\"><h3 id=\"perform\">Perform</h3>\n<p>You dont have to be great, just enthusiastic. Try to keep it to \naround six minutes.</p>\n<p><a href=\"https://github.com/wafflejs/wafflejs.github.io/issues/89\" class=\"btn\">Performer Details</a></p></div></div></div></section><section id=\"schedule\"><div class=\"container-fluid\"><div class=\"row\"><div class=\"col-xs-12 col-sm-6\"><h2>Schedule</h2><a ui-sref=\"past({day: index.last.day})\">Looking for last month?</a><ul class=\"schedule\"><li ng-repeat=\"event in index.day.schedule track by $index\"><div ng-repeat=\"(time, item) in event\" class=\"row row-lg-offset--3\"><div class=\"col-xs-12 col-lg-3 end-lg\"><h5>{{time}} <span class=\"hide-lg\"><span ng-show=\"item.type || item.emoji\"> </span><span ng-show=\"item.emoji\">{{item.emoji}} </span><span ng-show=\"item.type\">{{item.type}}</span></span></h5></div><div ng-show=\"item.person || item.type\" class=\"col-xs-12 col-lg-9\"><h5 ng-show=\"item.person\"><a ng-href=\"https://twitter.com/{{item.person.twitter}}\">{{item.person.name}}  @{{item.person.twitter}}</a></h5></div><div ng-show=\"item.type\" class=\"hide-md-down col-lg-3 end-lg\"><h5>{{item.type}}</h5></div><div ng-class=\"{ &quot;border-bottom&quot;: !item.description }\" class=\"col-xs-12 col-lg-9\"><h3 ng-show=\"item.title\" marked=\"item.title\"></h3></div><div ng-show=\"item.emoji &amp;&amp; item.description\" class=\"hide-md-down col-lg-3 end-lg\"><h5>{{item.emoji}}</h5></div><div ng-class=\"{ &quot;col-lg-offset-3&quot;: !item.emoji, &quot;border-bottom&quot;: item.description }\" marked=\"item.description\" class=\"col-xs-12 col-lg-9\"></div></div></li></ul></div></div></div></section><section id=\"sponsors\"><div class=\"container-fluid\"><div class=\"row\"><div class=\"col-xs-12 col-sm-6\"><h2 id=\"sponsors\">Sponsors</h2>\n<p>This months WaffleJS is sponsored by <a href=\"https://newrelic.com/about/careers\">New Relic</a> and <a href=\"https://www.opendoor.com/jobs\">Opendoor</a>.</p>\n<p>Interested in sponsoring a future event?</p>\n<p><a ui-sref=\"sponsorship\" class=\"btn\">Sponsorship Details</a></p></div><div class=\"col-xs-12 col-sm-6 row around-xs middle-xs\"><?xml version=\"1.0\" encoding=\"UTF-8\" standalone=\"no\"?>\n<svg width=\"100px\" height=\"84px\" viewBox=\"0 0 100 84\" version=\"1.1\" xmlns=\"http://www.w3.org/2000/svg\" xmlns:xlink=\"http://www.w3.org/1999/xlink\" xmlns:sketch=\"http://www.bohemiancoding.com/sketch/ns\">\n    <!-- Generator: Sketch 3.4.2 (15855) - http://www.bohemiancoding.com/sketch -->\n    <title>Artboard 1</title>\n    <desc>Created with Sketch.</desc>\n    <defs></defs>\n    <g id=\"Page-1\" stroke=\"none\" stroke-width=\"1\" fill=\"none\" fill-rule=\"evenodd\" sketch:type=\"MSPage\">\n        <g id=\"Artboard-1\" sketch:type=\"MSArtboardGroup\">\n            <g id=\"newrelic\" sketch:type=\"MSLayerGroup\" transform=\"translate(1.000000, 2.000000)\">\n                <g id=\"Group\" sketch:type=\"MSShapeGroup\">\n                    <g id=\"Shape\">\n                        <path d=\"M47.4076923,66.4076923 C32.4692308,66.4076923 20.3615385,54.2923077 20.3615385,39.3461538 C20.3615385,24.4076923 32.4692308,12.3 47.4076923,12.3 C62.3461538,12.3 74.4615385,24.4076923 74.4615385,39.3461538 C74.4615385,54.2923077 62.3461538,66.4076923 47.4076923,66.4076923 L47.4076923,66.4076923 L47.4076923,66.4076923 L47.4076923,66.4076923 Z M97.6923077,29.3769231 C93.0769231,8.15384615 67.6307692,-4.33076923 40.8538462,1.49230769 C14.0769231,7.31538462 -3.89230769,29.2384615 0.723076923,50.4538462 C5.33846154,71.6769231 30.7846154,84.1615385 57.5615385,78.3384615 C84.3384615,72.5153846 102.3,50.5923077 97.6923077,29.3769231 L97.6923077,29.3769231 L97.6923077,29.3769231 L97.6923077,29.3769231 Z\" fill=\"#616161\"></path>\n                        <path d=\"M47.4076923,65.9692308 C32.7076923,65.9692308 20.7923077,54.0538462 20.7923077,39.3461538 C20.7923077,24.6538462 32.7076923,12.7384615 