/***/ function(module, exports) {

	module.exports = "<p><title> Sponsorship</title></p><h1 id=sponsorship>Sponsorship</h1><h2 id=about>About</h2><p>WaffleJS is a monthly meetup centered around programming, waffles, and karaoke. It started when Visnu and Billy went to <a href=\"http://girlswhocode.com/\">BrooklynJS</a>. They were inspired by the event and wanted to organize a Bay Area technology meetup that would do these things:</p><ul><li>Have attendees actually meet and talk to one another.</li><li>Promote a diverse and inclusive environment.</li><li>Get people to have fun.</li></ul><p>Today the meetup is co-organized by <a href=https://twitter.com/visnup>Visnu</a>, <a href=https://twitter.com/billyroh>Billy</a>, <a href=https://twitter.com/kng>Kelly</a>, <a href=https://twitter.com/nexxylove>Emily</a> and <a href=https://twitter.com/thealphanerd>Myles</a>. Its held at <a href=https://goo.gl/maps/0gkOe>SoMa StrEat Food Park</a> every first Wednesday of the month.</p><h2 id=sponsorship-packages>Sponsorship Packages</h2><table><thead><tr><th style=text-align:center>1 Month<th style=text-align:center>3 Months<th style=text-align:center>6 Months<tbody><tr><td style=text-align:center>$500 total<td style=text-align:center>$1,350 total<td style=text-align:center>$2,400 total<tr><td style=text-align:center>Full Price<td style=text-align:center>Save 10%<td style=text-align:center>Save 20%</table><p>During the event, sponsors have a chance to talk to attendees in a casual setting. Here are some other things you get with your sponsorship:</p><ul><li><strong>Stage time:</strong> 2 minutes of stage time to do whatever you want with (the more creative the better).</li><li><strong>Free tickets:</strong> 2 tickets for people at your company.</li><li><strong>Swag and merch:</strong> Place to put stickers and swag on the check-in desk or on tables around the venue.</li><li><strong>Branding:</strong> Featured in the emails to the attendees and shown on wafflejs.com.</li></ul><h2 id=history>History</h2><p>The first session was in August 2015 and it has been held monthly ever since. We use funds to cover the cost of food, the venue, and equipment. We donate all profits to <a href=\"http://girlswhocode.com/\">Girls Who Code</a>, a non-profit that encourages more women to enter STEM fields.</p><table><thead><tr><th style=text-align:left>Month<th style=text-align:left>Sponsors<th style=text-align:right>Attendees<tbody><tr><td style=text-align:left><a href=/past/2015-08-05>August</a><td style=text-align:left>Opendoor, Particle<td style=text-align:right>66<tr><td style=text-align:left><a href=/past/2015-09-02>September</a><td style=text-align:left>Opendoor, Crunchyroll<td style=text-align:right>74<tr><td style=text-align:left><a href=/past/2015-10-07>October</a><td style=text-align:left>Opendoor<td style=text-align:right>120<tr><td style=text-align:left><a href=/past/2015-11-04>November</a><td style=text-align:left>New Relic, Opendoor<td style=text-align:right>95<tr><td style=text-align:left><a href=/past/2015-12-02>December</a><td style=text-align:left>Dropbox, Opendoor, New Relic<td style=text-align:right>125<tr><td style=text-align:left><a href=/past/2016-01-06>December</a><td style=text-align:left>Opendoor, New Relic<td style=text-align:right>103</table><h2 id=speakers-attendees>Speakers &amp; Attendees</h2><p>Our past speakers have worked as developers at established companies, as well as smaller startups. Here are a few of those companies:</p><ul><li>Google</li><li>Mozilla</li><li>Dropbox</li><li>Square</li><li>Stripe</li><li>npm</li></ul><p>Our attendees are roughly the same ratio of people from larger and smaller companies, leaning toward smaller startups. Around 35% of our attendees are women.</p><h2 id=diversity>Diversity</h2><p>We believe this industry can and should be more inclusive. Here are the things we do to make that happen:</p><ul><li><strong>Donations:</strong> We donate all proceeds to Girls Who Code, a non-profit that encourages more women to enter the STEM field.</li><li><strong>Student sponsorships:</strong> We sponsor students to come to the event so they can meet more people in the industry. So far, weve had students from Hackbright and Hack Reactor.</li><li><strong>Diverse speakers:</strong> We make sure that we have a wide range of speakers at each of our events, with an eye toward gender, racial, and socioeconomic diversity.</li></ul><h2 id=contact-us>Contact Us</h2><p>If youre interested in sponsoring WaffleJS, please contact us at <a href=mailto:sponsorship@wafflejs.com>sponsorship@wafflejs.com</a>. Please keep in mind that we do not select speakers the same month their company sponsors us. We do however encourage you to submit for the next month.</p>";

